import React from 'react';

const EventList = ({ events, onEdit, onDelete }) => {
    return (
        <ul className="EventList"> {/* Apply the EventList class for styling */}
            {events.map(event => (
                <li key={event.id} className="EventItem"> {/* Optionally add EventItem class for individual items */}
                    {event.title} - {event.type} from {event.startDate} to {event.endDate}
                    <button className="button-edit" onClick={() => onEdit(event.id)}>Edit</button>
                    <button className="button-delete" onClick={() => onDelete(event.id)}>Delete</button>
                </li>
            ))}
        </ul>
    );
};

export default EventList;
